import React from "react";
import { styled } from "@mui/material/styles";

import { Grid, Paper } from "@mui/material";

export default function Subscription() {
  return (
    <>
      <Grid container spacing={2}>
        <Grid item xs={3}>
          <Paper>xs=8</Paper>
        </Grid>
        <Grid item xs={3}>
          <Paper>xs=4</Paper>
        </Grid>
        <Grid item xs={3}>
          <Paper>xs=4</Paper>
        </Grid>
      </Grid>
    </>
  );
}
